import { Grid, Typography, Box
 } from "@mui/material";

function App() {
  return (
    <Grid container>
      <Box
        sx={{
          height: "100vh",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography variant="h1">Fato ou Fake?</Typography>
        <Typography variant="text">Fato ou Fake?</Typography>
      </Box>
    </Grid>
  );
}

export default App;
